import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import './LeagueFixtures.css';

export default function LeagueFixtures() {
  const { id } = useParams(); // league_id from route
  const [fixtures, setFixtures] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showPast, setShowPast] = useState(false);
  const [formatFilter, setFormatFilter] = useState('');

  useEffect(() => {
    const fetchFixtures = async () => {
      try {
        setLoading(true);

        const today = new Date();
        const start = showPast
          ? new Date(today.getTime() - 90 * 24 * 60 * 60 * 1000)
          : today;
        const end = showPast
          ? today
          : new Date(today.getTime() + 90 * 24 * 60 * 60 * 1000);

        const startStr = start.toISOString().split('T')[0];
        const endStr = end.toISOString().split('T')[0];

        const res = await fetch(`/api/fixtures?league_id=${id}&start=${startStr}&end=${endStr}`);
        const data = await res.json();
        setFixtures(data.data || []);
      } catch (err) {
        console.error('❌ Error fetching fixtures:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchFixtures();
  }, [id, showPast]);

  const filteredFixtures = fixtures.filter(fix => {
    if (!formatFilter) return true;
    return fix.league?.name?.toLowerCase().includes(formatFilter.toLowerCase());
  });

  return (
    <div className="league-fixtures-container">
      <h2>League Fixtures</h2>

      <div className="toggle-buttons">
        <button className={!showPast ? 'active' : ''} onClick={() => setShowPast(false)}>
          Upcoming
        </button>
        <button className={showPast ? 'active' : ''} onClick={() => setShowPast(true)}>
          Past
        </button>
      </div>

      <div className="format-buttons">
        {['All', 'T20', 'ODI', 'Test'].map((fmt) => (
          <button
            key={fmt}
            className={formatFilter === fmt || (!formatFilter && fmt === 'All') ? 'active' : ''}
            onClick={() => setFormatFilter(fmt === 'All' ? '' : fmt)}
          >
            {fmt}
          </button>
        ))}
      </div>

      {loading ? (
        <p>Loading fixtures...</p>
      ) : filteredFixtures.length === 0 ? (
        <p>No fixtures found.</p>
      ) : (
        <div className="fixtures-list">
          {filteredFixtures.map((fix) => (
            <div key={fix.id} className="fixture-card">
              <div className="teams">
                <div className="team">
                  <img src={fix.localteam.image_path} alt={fix.localteam.name} />
                  <span>{fix.localteam.name}</span>
                </div>
                <span className="vs">vs</span>
                <div className="team">
                  <img src={fix.visitorteam.image_path} alt={fix.visitorteam.name} />
                  <span>{fix.visitorteam.name}</span>
                </div>
              </div>
              <div className="details">
                <p><strong>Date:</strong> {new Date(fix.starting_at).toLocaleString()}</p>
                <p><strong>League:</strong> {fix.league.name}</p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
